function detailAfiliasiDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-Afiliasi-detail').modal('show');

				$('#Detail-Afiliasi-Deskripsi').val(data.deskripsi);
				$('#Detail-Afiliasi-FileAfiliasiId').val(data.fileAfiliasiId);
				$('#Detail-Afiliasi-Share').val(data.share);
				$('#Detail-Afiliasi-Terafiliasi').val(data.terafiliasi);
				$('#Detail-Afiliasi-TipeAfiliasi').val(data.tipeAfiliasi);
				$('#Detail-Afiliasi-VendorId').val(data.vendorId);

}
